import React from "react";

class SearchBar extends React.Component {
  state = {value: ''}
  onInputChange = () => {
    this.state.bind(value)
  }
  render() {
    return(
      <div>
        <form>
          <div>
            <label>Video search</label>
            <input type="text" value = {this.state.value}/>
          </div>
        </form>
      </div>
    )
  }
}

export default SearchBar;
